CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertPastSensorData` ()   BEGIN
    DECLARE start_date DATE;
    DECLARE end_date DATE;
    DECLARE i INT;
    DECLARE rand_time TIME;
    DECLARE rand_tempC_01 FLOAT;
    DECLARE rand_tempC_02 FLOAT;
    DECLARE rand_humidity FLOAT;
    DECLARE rand_water_flow FLOAT;
    
    -- Define the date range (From 30 days ago to today)
    SET start_date = DATE_SUB(CURDATE(), INTERVAL 30 DAY);
    SET end_date = CURDATE();

    -- Loop through each day
    WHILE start_date <= end_date DO
        SET i = 1;
        
        -- Insert 8 random values for each day
        WHILE i <= 8 DO
            SET rand_time = SEC_TO_TIME(FLOOR(RAND() * 86400));  -- Random time of the day
