            SET rand_humidity = ROUND(30 + (RAND() * 20), 2);    -- Random humidity between 30-50%
            SET rand_water_flow = ROUND(10 + (RAND() * 90), 2);  -- Random flow rate between 10-100 L/min
            
            -- Insert the generated data
            VALUES (CONCAT(start_date, ' ', rand_time), rand_tempC_01, rand_tempC_02, rand_humidity, rand_water_flow);
            
            SET i = i + 1;
        END WHILE;

        -- Move to the next day
        SET start_date = DATE_ADD(start_date, INTERVAL 1 DAY);
    END WHILE;
END$$

